{
  "reportType": "HRUS – Inguinal Region",
  "indication": "",
  "method": "",
  "sections": [
    {
      "title": "Findings",
      "contentType": "text",
      "content": "Irregular hypoechoic lesion measuring ~5.2 x 5.4 x 3.8 cm (~55 cc) seen involving the belly portion of the supraspinatus muscle with adjacent stranding and few mildly enlarged hypoechoic lymph nodes in the suprascapular region measuring ~1 cm with loss of fatty hilum. Irregular hypoechoic tract noted from the subcutaneous aspect of the suprapubic region in the right parasagittal location into the inguinal region measuring 2.5 cm in length with a 4.0 mm defect in the abdominal wall. Anechoic collection noted in the peritoneal cavity measuring ~2.5 x 1.3 x 1.8 cm with internal echoes and probe tenderness. Tract from the subcutaneous aspect seen extending into this lesion. No obvious vessels within. Rest of the abdominal wall shows normal thickness and echotexture. Bowel loops and urinary bladder are normal."
    }
  ],
  "tables": [],
  "impression": "Small intraabdominal collection with tract to the subcutaneous aspect in the suprapubic region as described (Sinus).",
  "followUp": ""
}

